// 예약상세3 - 시간선택
import React,{useState} from 'react';

function TimeSelect() {
    const [value, onChange] = useState(new Date());
  
    return (
      <div>
        <button>10:00</button>
        <button>11:00</button>
        <button>12:00</button>
        <button>13:00</button>
        <button>14:00</button>
        <button>15:00</button>
        <button>16:00</button>
        <button>17:00</button>
        <button>18:00</button>
        <button>19:00</button>
        <button>20:00</button>

      </div>
      
    );
  }
  export default TimeSelect;
